// src/components/Register.js
import React, { useState } from 'react';
import { useTranslation } from 'react-i18next';
import { useNavigate } from 'react-router-dom';
import { Container, Typography, Box, Paper } from '@mui/material';
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import { motion } from 'framer-motion';
import RegisterForm from './RegisterForm';

const Register = () => {
  const { t } = useTranslation();
  const navigate = useNavigate();
  const [isLoading, setIsLoading] = useState(false);

  const handleSubmit = async (values) => {
    setIsLoading(true);
    console.log("Enviando dados de registro:", values);
    const response = await fetch('http://localhost:5000/register', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify(values)
    });
    const data = await response.json();
    setIsLoading(false);
    console.log("Resposta do servidor:", data);
    if (response.ok) {
      toast.success(data.message || 'Usu치rio registrado com sucesso!');
      navigate('/dashboard');
    } else {
      toast.error(data.message || 'Erro ao registrar');
    }
  };

  return (
    <Container maxWidth="md">
      <ToastContainer />
      <Paper elevation={3} sx={{ padding: 4, marginTop: 4 }}>
        <motion.div
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ duration: 1 }}
        >
          <Typography variant="h4" gutterBottom>
            {t('Formul치rio Pessoal')}
          </Typography>
          <Box>
            <Typography variant="h6">{t('Registrar')}</Typography>
            <RegisterForm isLoading={isLoading} onSubmit={handleSubmit} />
          </Box>
        </motion.div>
      </Paper>
    </Container>
  );
}

export default Register;
